import React from "react";
import avatar from "../../assets/man.svg";
import classes from "./Avatars.module.css";
import a1 from "../../assets/a1.jpeg";
import a2 from "../../assets/a2.jpeg";
import a3 from "../../assets/a3.jpeg";
import a4 from "../../assets/14.jpeg";
import a5 from "../../assets/15.jpeg";
const Avatars = () => (
  <React.Fragment>
    <div className={classes.header_avatars}>
      <div className={[classes.avatar, classes.a1].join(" ")}>
        <img src={a1} alt="avatar" />
      </div>
      <div className={[classes.avatar, classes.a2].join(" ")}>
        <img src={a2} alt="avatar" />
      </div>
      <div className={[classes.avatar, classes.a3].join(" ")}>
        <img src={a3} alt="avatar" />
      </div>
      <div className={[classes.avatar, classes.a4].join(" ")}>
        <img src={a4} alt="avatar" />
      </div>
      <div className={[classes.avatar, classes.a5].join(" ")}>
        <img src={a5} alt="avatar" />
      </div>
    </div>
  </React.Fragment>
);
export default Avatars;
